script: |
  super -f tsv -I q7412.sql | sort > q7412.out

vector: true

inputs:
  - name: q7412.sql
    data: |
      SELECT DISTINCT + COUNT ( * ) AS col1, 74 FROM tab0 WHERE - + col1 * 10 + + - 14 / - + CAST ( + - 94 AS INTEGER ) <> + - col1 / + col1 + - 6;
  - name: tab0

outputs:
  - name: q7412.out
    data: |
      3	74
